using Microsoft.AspNetCore.HttpOverrides;
using Microsoft.AspNetCore.Identity;
using Microsoft.AspNetCore.OData;
using Microsoft.AspNetCore.RateLimiting;
using Microsoft.EntityFrameworkCore;
using Microsoft.OData.ModelBuilder;
using Microsoft.OpenApi.Models;
using System.Globalization;
using System.Security.Claims;
using System.Text.Json;
using System.Text.Json.Serialization;
using System.Threading.RateLimiting;
using BlazorRecipes.Data;
using BlazorRecipes.Models;
using BlazorRecipes.Services;
using BlazorRecipes.Shared.Models;

Environment.CurrentDirectory = AppContext.BaseDirectory;

var webRootPath = Path.Combine(AppContext.BaseDirectory, "wwwroot");

if (!Directory.Exists(webRootPath))
{
    Directory.CreateDirectory(webRootPath);
}

var builder = WebApplication.CreateBuilder(args);

builder.Services.Configure<RouteOptions>(options =>
{
    options.LowercaseUrls = true;
    options.LowercaseQueryStrings = true;
});

// Add services to the container.
ODataConventionModelBuilder modelBuilder = new();
modelBuilder.EntitySet<Reviews>("Reviews");
modelBuilder.EntitySet<Units>("Units");
modelBuilder.EntitySet<Ingredients>("Ingredients");
modelBuilder.EntitySet<Tags>("Tags");
modelBuilder.EntitySet<Recipes>("Recipes");
modelBuilder.EntitySet<RecipeIngredients>("RecipeIngredients");
modelBuilder.EntitySet<ApplicationUserDto>("User");

builder.Services.AddControllers()
    .AddOData(options => options.EnableQueryFeatures().AddRouteComponents("odata", modelBuilder.GetEdmModel()))
    .AddJsonOptions(options => options.JsonSerializerOptions.ReferenceHandler = ReferenceHandler.IgnoreCycles);

// Learn more about configuring Swagger/OpenAPI at https://aka.ms/aspnetcore/swashbuckle
builder.Services.AddEndpointsApiExplorer();
builder.Services.AddSwaggerGen(options =>
{
    options.SwaggerDoc("v1", new OpenApiInfo
    {
        Title = "Blazor Recipes API",
        Version = "v1"
    });

    options.AddSecurityDefinition("Bearer", new()
    {
        In = ParameterLocation.Header,
        Name = "Authorization",
        Type = SecuritySchemeType.Http,
        Scheme = "Bearer"
    });

    options.AddSecurityRequirement(new()
    {
        {
            new OpenApiSecurityScheme
            {
                Reference = new OpenApiReference
                {
                    Type = ReferenceType.SecurityScheme,
                    Id = "Bearer"
                }
            },
            Array.Empty<string>()
        }
    });
});

builder.Services.AddAuthorization();

builder.Services.AddDbContext<ApplicationDbContext>(options =>
{
    options.UseSqlite(builder.Configuration.GetConnectionString("ApplicationDbContext"));
});

builder.Services.AddRazorPages();

builder.Services.AddIdentityApiEndpoints<ApplicationUser>()
    .AddRoles<IdentityRole>()
    .AddEntityFrameworkStores<ApplicationDbContext>();

builder.Services.AddRateLimiter(options =>
{
    // Window Rate Limiter
    options.AddFixedWindowLimiter("Fixed", opt =>
    {
        opt.Window = TimeSpan.FromMinutes(1);
        opt.PermitLimit = 100;
        opt.QueueLimit = 0;
        opt.AutoReplenishment = true;
    });

    // Sliding Window Rate Limiter
    options.AddSlidingWindowLimiter("Sliding", opt =>
    {
        opt.Window = TimeSpan.FromSeconds(10);
        opt.PermitLimit = 4;
        opt.QueueLimit = 2;
        opt.QueueProcessingOrder = QueueProcessingOrder.OldestFirst;
        opt.SegmentsPerWindow = 2;

    });

    // Token Bucket Rate Limiter
    options.AddTokenBucketLimiter("Token", opt =>
    {
        opt.TokenLimit = 4;
        opt.QueueLimit = 2;
        opt.QueueProcessingOrder = QueueProcessingOrder.OldestFirst;
        opt.ReplenishmentPeriod = TimeSpan.FromSeconds(10);
        opt.TokensPerPeriod = 4;
        opt.AutoReplenishment = true;

    });

    //Concurrency Limiter
    options.AddConcurrencyLimiter("Concurrency", opt =>
    {
        opt.PermitLimit = 10;
        opt.QueueLimit = 2;
        opt.QueueProcessingOrder = QueueProcessingOrder.OldestFirst;

    });

    options.OnRejected = async (context, token) =>
    {
        context.HttpContext.Response.StatusCode = StatusCodes.Status429TooManyRequests;
        if (context.Lease.TryGetMetadata(MetadataName.RetryAfter, out var retryAfter))
        {
            context.HttpContext.Response.Headers.RetryAfter =
                ((int) retryAfter.TotalSeconds).ToString(NumberFormatInfo.InvariantInfo);

            await context.HttpContext.Response.WriteAsync(
                $"Too many requests. Please try again after {retryAfter.TotalMinutes} minute(s). " +
                $"Read more about our rate limits at https://www.radendpoint.com/faq/.", cancellationToken: token);
        }
        else
        {
            await context.HttpContext.Response.WriteAsync(
                "Too many requests. Please try again later. " +
                "Read more about our rate limits at https://www.radendpoint.com/faq/.", cancellationToken: token);
        }
    };
});

builder.Services.Configure<ForwardedHeadersOptions>(options =>
{
    options.ForwardedHeaders = ForwardedHeaders.All;
});

builder.Services.AddScoped<ImageService>();

var app = builder.Build();

// Configure the HTTP request pipeline.
//if (app.Environment.IsDevelopment())
//{
//    app.UseSwagger();
//    app.UseSwaggerUI();
//}

app.UseSwagger();
app.UseSwaggerUI();

app.UseHttpsRedirection();
app.UseForwardedHeaders();

if (app.Environment.IsDevelopment())
{
    app.UseWebAssemblyDebugging();
}
else
{
    app.UseExceptionHandler("/Error");
    // The default HSTS value is 30 days. You may want to change this for production scenarios, see https://aka.ms/aspnetcore-hsts.
    app.UseHsts();
}

app.UseBlazorFrameworkFiles();
app.UseStaticFiles();

app.UseRouting();

app.MapRazorPages();

app.UseAuthorization();

app.MapGroup("/identity").MapIdentityApi<ApplicationUser>().WithTags("Identity");

app.MapControllers();

app.MapFallbackToFile("index.html");

using (var scope = app.Services.CreateScope())
{
    var services = scope.ServiceProvider;
    var ctx = services.GetRequiredService<ApplicationDbContext>();

    var databaseExisted = ctx.Database.GetAppliedMigrations().Any();

    //Uncomment to delete and create database
    //ctx.Database.EnsureDeleted();
    //ctx.Database.EnsureCreated();

    ctx.Database.Migrate();

    if (!databaseExisted)
    {
        var imageService = services.GetRequiredService<ImageService>();

        var roleManager = services.GetRequiredService<RoleManager<IdentityRole>>();
        await roleManager.CreateAsync(new() { Name = "Administrator" });

        var userManager = services.GetRequiredService<UserManager<ApplicationUser>>();

        var (photoExtension, photoBytes) = ImageService.GetImageFromDataUri("data:image/png;base64,");
        using MemoryStream photoStream = new(photoBytes);
        var photo = await imageService.SaveToUploadsAsync(photoExtension, photoStream);

        ApplicationUser adminUser = new()
        {
            Email = "adminuser@example.com",
            UserName = "adminuser@example.com",
            FirstName = "Admin",
            LastName = "User",
            Title = "N/A",
            CompanyName = "Testing Company",
            Photo = photo,
        };

        await userManager.CreateAsync(adminUser, "testUser123!");
        await userManager.AddToRoleAsync(adminUser, "Administrator");
 
        ApplicationUser normalUser = new()
        {
            Email = "normaluser@example.com",
            UserName = "normaluser@example.com",
            FirstName = "Normal",
            LastName = "User",
            Title = "N/A",
            CompanyName = "Testing Company",
            Photo = photo,
        };

        await userManager.CreateAsync(normalUser, "testUser123!");
        

        
        if (File.Exists("Units.Data.json"))
        {
            var json = File.ReadAllText("Units.Data.json");
            var data = JsonSerializer.Deserialize<Units[]>(json);

            if (data != null)
            {
                ctx.Units.AddRange(data);
                ctx.SaveChanges();
            }
        }
        if (File.Exists("Ingredients.Data.json"))
        {
            var json = File.ReadAllText("Ingredients.Data.json");
            var data = JsonSerializer.Deserialize<Ingredients[]>(json);

            if (data != null)
            {
                ctx.Ingredients.AddRange(data);
                ctx.SaveChanges();
            }
        }

        if (File.Exists("Tags.Data.json"))
        {
            var json = File.ReadAllText("Tags.Data.json");
            var data = JsonSerializer.Deserialize<Tags[]>(json);

            if (data != null)
            {
                ctx.Tags.AddRange(data);
                ctx.SaveChanges();
            }
        }

        if (File.Exists("Recipes.Data.json"))
        {
            var json = File.ReadAllText("Recipes.Data.json");
            var data = JsonSerializer.Deserialize<Recipes[]>(json);

            if (data != null)
            {
                foreach (var record in data)
                {
                    if ((record.Photo?.StartsWith("data:image/png;base64,") ?? false) || (record.Photo?.StartsWith("data:image/jpeg;base64,") ?? false))
                    {
                        var (extension, bytes) = ImageService.GetImageFromDataUri(record.Photo);
                        using MemoryStream stream = new(bytes);
                        var image = await imageService.SaveToUploadsAsync(extension, stream);

                        record.Photo = image;
                    }
                }
                ctx.Recipes.AddRange(data);
                ctx.SaveChanges();
            }
        }

        if (File.Exists("Reviews.Data.json"))
        {
            var json = File.ReadAllText("Reviews.Data.json");
            var data = JsonSerializer.Deserialize<Reviews[]>(json);

            if (data != null)
            {
                ctx.Reviews.AddRange(data);
                ctx.SaveChanges();
            }
        }
    }
}
app.UseRateLimiter();
app.Run();
